import React from "react";
import { useState } from "react";

const Transactions = () => {
  const [transactionData, setTransactionData] = useState();

  const simpleTransactionCall = async () => {
    //Call our local server
    const response = await fetch("api/transactions", {
      method: "GET",
    });

    const data = await response.json();
    setTransactionData(data);
    let tRact = data.transactions;

    console.log(tRact);
    console.log(
      `Here is your data! ${JSON.stringify(data.transactions, undefined, 4)}`
    );
  };

  return (
    <div>
      <button onClick={simpleTransactionCall}>Get Transactions!</button>
    </div>
  );
};

export default Transactions;
